        private static List<Anuncios> Ordenar(string col, string sortDirection, IEnumerable<Anuncios> lista)
        {
            switch (sortDirection)
            {
                case "desc":
                    {
                        if ("Titulo".Equals(col))
                        {
                            lista = lista.OrderByDescending(l => l.Titulo);

                        }
                        else
                        if ("Precio".Equals(col))
                        {
                            lista = lista.OrderByDescending(l => l.Precio);

                        }
                        else
                        if ("FechaCreacion".Equals(col))
                        {
                            lista = lista.OrderByDescending(l => l.FechaCreacion);

                        }
                        else
                        if ("FechaModificacion".Equals(col))
                        {
                            lista = lista.OrderByDescending(l => l.FechaModificacion);

                        }
                        else
                        if ("ProductoNuevo".Equals(col))
                        {
                            lista = lista.OrderByDescending(l => l.ProductoNuevo);

                        }
                        else
                        if ("Provincia".Equals(col))
                        {
                            lista = lista.OrderByDescending(l => l.Provincia);

                        }
                        else
                        if ("Municipio".Equals(col))
                        {
                            lista = lista.OrderByDescending(l => l.Municipio);

                        }
                        else
                        if ("IsVisible".Equals(col))
                        {
                            lista = lista.OrderByDescending(l => l.IsVisible);

                        }
                        else
                        if ("IsActivo".Equals(col))
                        {
                            lista = lista.OrderByDescending(l => l.IsActivo);

                        }
                        else
                        if ("ContadorView".Equals(col))
                        {
                            lista = lista.OrderByDescending(l => l.ContadorView);

                        }
                        else
                        if ("NombreContacto".Equals(col))
                        {
                            lista = lista.OrderByDescending(l => l.NombreContacto);

                        }

                        break;
                    }

                default:
                    {
                        if ("Titulo".Equals(col))
                        {
                            lista = lista.OrderBy(l => l.Titulo);

                        }
                        else
                       if ("Precio".Equals(col))
                        {
                            lista = lista.OrderBy(l => l.Precio);

                        }
                        else
                       if ("FechaCreacion".Equals(col))
                        {
                            lista = lista.OrderBy(l => l.FechaCreacion);

                        }
                        else
                        if ("FechaModificacion".Equals(col))
                        {
                            lista = lista.OrderBy(l => l.FechaModificacion);

                        }
                        else
                       if ("ProductoNuevo".Equals(col))
                        {
                            lista = lista.OrderBy(l => l.ProductoNuevo);

                        }
                        else
                       if ("Provincia".Equals(col))
                        {
                            lista = lista.OrderBy(l => l.Provincia);

                        }
                        else
                       if ("Municipio".Equals(col))
                        {
                            lista = lista.OrderBy(l => l.Municipio);

                        }
                        else
                       if ("IsVisible".Equals(col))
                        {
                            lista = lista.OrderBy(l => l.IsVisible);

                        }
                        else
                       if ("IsActivo".Equals(col))
                        {
                            lista = lista.OrderBy(l => l.IsActivo);

                        }
                        else
                       if ("ContadorView".Equals(col))
                        {
                            lista = lista.OrderBy(l => l.ContadorView);

                        }
                        else
                       if ("NombreContacto".Equals(col))
                        {
                            lista = lista.OrderBy(l => l.NombreContacto);

                        }

                        break;

                    }
            }

            return lista.ToList();
        }

