        // PUT: api/Anuncios/5
        [Authorize]
        [HttpPut("{id}")]
        public async Task<IActionResult> PutAnuncio([FromRoute] int id, [FromBody] AnuncioViewModel model)
        {
            if (!ModelState.IsValid)
            {
                return BadRequest(ModelState);
            }

            Anuncios anuncio = _anunciosRepository.Find(model.AnuncioId);
            string nombreImg = "";
            if (id != anuncio.AnuncioId)
            {
                return BadRequest();
            }
            anuncio.FechaModificacion = DateTime.Now;

            anuncio.Accion = model.Accion;
            anuncio.ContadorView = model.ContadorView;
            anuncio.CorreoContacto = model.CorreoContacto;
            anuncio.Descripcion = model.Descripcion;
            anuncio.NombreContacto = model.NombreContacto;
            anuncio.Precio = model.Precio;
            anuncio.TelefonoContacto = model.TelefonoContacto;
            anuncio.Titulo = model.Titulo;
            anuncio.Provincia = model.Provincia;
            anuncio.Municipio = model.Municipio;
            anuncio.Url = model.Url;
            anuncio.FechaModificacion = DateTime.Now;
            anuncio.IsActivo = model.IsActivo;
            anuncio.IsVisible = model.IsVisible;
            anuncio.ImageMimeType = model.ImageMimeType;
            anuncio.ProductoNuevo = model.ProductoNuevo;
            Usuario u = _usuariorepository.Queryable().Include(c => c.ClasesUsuarios).First(x => x.UsuarioId == model.Usuario.UsuarioId);
            anuncio.Usuario = u;
            if (model.ImageName != null && model.ImageContent != "" )
            {
                //------------Eliminar imagenes viejas primero---------
                if (anuncio.ImageName != null && anuncio.ImageContent != "" && Tools.ExistImagen(anuncio.ImageName, images_path))
                {
                    Tools.DeleteImagen(anuncio.ImageName, images_path);
                    Tools.DeleteImagen(anuncio.ImageName, images_path_mini);
                }
              

                //--------------------fin-------------------

                nombreImg = Tools.GenerarNombre(model.ImageName);
                Tools.SaveImages(model.ImageContent, nombreImg, images_path);
                Tools.RedimensionAndSaveImages(model.ImageContent, nombreImg, images_path_mini, 346, 264, model.Rotacion);
                anuncio.ImageName = nombreImg;
            }

           
            //Zuleidy Actualizar etiquetas
            if (_anuncioEtiquetasrepository.Queryable().Any(x => x.AnuncioId == anuncio.AnuncioId))
            {
                _anuncioEtiquetasrepository.DeleteRange(_anuncioEtiquetasrepository.Queryable().Where(x => x.AnuncioId == anuncio.AnuncioId));
                await _unitOfWork.SaveChangesAsync();
            }

            var etiquetas = model.Etiquetas;
            if (etiquetas != null && etiquetas.Count > 0)
            {
                foreach (var item in etiquetas)
                {

                    Etiqueta et = _etiquetasrepository.Queryable().First(f => f.EtiquetaId == item.EtiquetaId);
                    AnuncioEtiquetas anet = new AnuncioEtiquetas();
                    anet.Etiqueta = et;
                    anet.EtiquetaId = et.EtiquetaId;
                    anet.AnuncioId = anuncio.AnuncioId;
                    anet.IsFree = item.IsFree;
                    _anuncioEtiquetasrepository.Create(anet);
                }
            }

            anuncio.ImageContent = "";
            _anunciosRepository.Update(anuncio);
            await _unitOfWork.SaveChangesAsync();


            //Zuleidy Actualizar Banners
           if (_bannersrepository.Queryable().Any(x => x.AnuncioId == anuncio.AnuncioId))
            {
                var banExis = _bannersrepository.Queryable().Where(x => x.AnuncioId == anuncio.AnuncioId);

                foreach (var item in banExis)
                {
                    if (!model.Banners.Any(x => x.BannerId== item.BannerId))
                    {
                        //------------Eliminar imagenes viejas primero---------
                        Tools.DeleteImagen(item.ImageName, images_banner_inferior_path);
                        Tools.DeleteImagen(item.ImageName, images_banner_path);
                        //--------------------fin-------------------
                        _bannersrepository.Delete(item);

                    }
                   
                }
                try
                {
                    await _unitOfWork.SaveChangesAsync();
                }
                catch (Exception ex)
                {

                    throw;
                }
               

            }

     
            var banners = model.Banners.Where(x => x.ImageName != "");
            if (banners != null && banners.Count() > 0)
            {
                foreach (var item in banners)
                {
                    Banners ban = new Banners();
                    // if (!Tools.ExistImagen(item.ImageName, images_almacen_path))
                    if (_bannersrepository.Queryable().Any(x => x.BannerId == item.BannerId))
                        ban = _bannersrepository.Queryable().First(x => x.BannerId == item.BannerId);

                        ban.Nombre = item.Nombre;
                        ban.Url = item.Url;
                        ban.Tipo = item.Tipo;
                        ban.CantidadDias = item.CantidadDias;

                        ban.IsActivo = item.IsActivo;
                        ban.FechaCreacion = item.FechaCreacion;
                        //ban.FechaUltView = item.FechaUltView;
                       
                        ban.AnuncioId = anuncio.AnuncioId;
                        ban.ImageName = item.ImageName;
                        ban.ImageMimeType = item.ImageMimeType;

                    //**************Salvar Imagen******************
                    if (ban.Tipo == "Inferior")
                    {
                        Tools.DeleteImagen(item.ImageName, images_banner_inferior_path);
