        // DELETE: api/Anuncios/5
        [Authorize]
        [HttpDelete("{id}")]
        public async Task<IActionResult> DeleteAnuncio([FromRoute] int id)
        {
            if (!ModelState.IsValid)
            {
                return BadRequest(ModelState);
            }

            var anuncio = await _anunciosRepository.FindAsync(id);
            if (anuncio == null)
            {
                return NotFound();
            }
            try
            {
                if (_denunciasrepository.Queryable().Any(x=>x.AnuncioId==id))
                {
                    _denunciasrepository.DeleteRange(_denunciasrepository.Queryable().Where(x=>x.AnuncioId==id));

                }
                _anunciosRepository.Delete(anuncio);
                await _unitOfWork.SaveChangesAsync();
            }
            catch (Exception ex)
            {

                throw;
            }

            

            return Ok(anuncio);
        }


