        public int GetAnunciosPopularesCount(string col = "", string filter = "", string sortDirection = "asc")
        {
            IEnumerable<AnuncioViewModel> lista = new List<AnuncioViewModel>();
            // List<AnuncioViewModel> lista = new List<AnuncioViewModel>();
            List<Anuncios> anuncios = new List<Anuncios>();
            if (!string.IsNullOrEmpty(filter))
            {
                anuncios = _anunciosRepository.Queryable()
                    .Where(p => p.IsVisible && ((p.Titulo.ToLower().Contains(filter.ToLower())) || (p.NombreContacto.ToLower().Contains(filter.ToLower())) || (p.TelefonoContacto.ToLower().Contains(filter.ToLower()))
                    || (p.CorreoContacto.ToLower().Contains(filter.ToLower())) || (p.Url.ToLower().Contains(filter.ToLower()))
                    || (p.AnuncioEtiquetas.Where(et => et.Etiqueta.Nombre.Contains(filter.ToLower())).Count() > 0)))
                    
                    .OrderByDescending(r => r.ContadorView)
                    .ToList();
            }
            else
            {
                anuncios = _anunciosRepository.Queryable()
                    .Where(p => p.IsVisible)                    
                     .OrderByDescending(r => r.ContadorView)                   
                    .ToList();
            }

          
            return anuncios.Count();

        }
        
