                        .Where(p => p.IsVisible && ((p.Titulo.ToLower().Contains(filter.ToLower())) || (p.NombreContacto.ToLower().Contains(filter.ToLower())) || (p.TelefonoContacto.ToLower().Contains(filter.ToLower()))
                        || (p.CorreoContacto.ToLower().Contains(filter.ToLower())) || (p.Url.ToLower().Contains(filter.ToLower()))
                        || (p.AnuncioEtiquetas.Where(et => et.Etiqueta.Nombre.Contains(filter.ToLower())).Count() > 0)))
                        .Count();
                    return cantidad;
                }
                else
                {
                    cantidad = _anunciosRepository.Queryable()
                        .Where(p => p.IsVisible)
                        .Count();
                    return cantidad;
                }

            }
            else
            {
                return GetAnunciosPopularesCount(col, filter, sortDirection);
            }

        }


