        [HttpPost]
        [Route("Avanzados")]
        public IEnumerable<AnuncioViewModel> GetAnunciosAvanzados(BuscarAnuncio buscar)
        {
            try
            {
                if (buscar.ListaEtiquetas.Count > 0)
                {
                    int i = 0;
                    foreach (EtiquetaViewModel et in buscar.ListaEtiquetas)
                    {
                        if (i == 0)
                        {
                            i = 1;
                            buscar.EtiquetasConcat = et.Nombre;
                        }
                        else
                        {
                            buscar.EtiquetasConcat += '-' + et.Nombre;
                        }
                    }

            }

            List<AnuncioViewModel> lista = new List<AnuncioViewModel>();
            var anuncios = _unitOfWork.getAnunciosAvanzados(buscar.indexPage, buscar.sizePage, buscar.Accion, buscar.Provincia, buscar.Municipio, buscar.Titulo, buscar.Url, buscar.NombreContacto, buscar.TelefonoContacto, buscar.CorreoContacto, buscar.Categoria, buscar.Descripcion, buscar.HasFoto, buscar.PrecioMin, buscar.PrecioMax, buscar.EtiquetasConcat, buscar.IsWeb, buscar.ProductoNuevo);

        
            foreach (var item in anuncios)
            {
                item.OpcionAvanzadas = _opcionesAvanzadasrepository.Queryable().Where(op => op.AnuncioId == item.AnuncioId && op.IsActivo == true)
                      .Include(p => p.TipoOpcion)
                      .ToList();
                item.Banners = _bannersrepository.Queryable().Where(op => op.AnuncioId == item.AnuncioId).ToList();
                item.AnuncioEtiquetas = _anuncioEtiquetasrepository.Queryable()
                    .Include(x => x.Etiqueta)
                    .ThenInclude(x => x.CategoriaEtiqueta)
                    .ThenInclude(y => y.Categoria)
                    .Where(op => op.AnuncioId == item.AnuncioId).ToList();
                item.AlmacenImagen = _imagenesAdicionalesrepository.Queryable().Where(op => op.AnuncioId == item.AnuncioId).ToList();
                item.Denuncias = _denunciasrepository.Queryable().Where(op => op.AnuncioId == item.AnuncioId).ToList();
                lista.Add(MapToAnuncioView(item));
            }

                return lista;
            }
            catch (Exception)
            {

                throw;
            }

       
        }

