        /// <summary>
        /// Bonifica la cantidad de puntos de un usario si no ha insertado un anuncio en el dia
        /// </summary>
        /// <param name="user"></param>
        private decimal GetBonificacionInsertarAnuncioDiario(Usuario user)
        {
           
            if (user.FechaUltimoAnuncio == null || user.FechaUltimoAnuncio.Value.DayOfYear != DateTime.Today.DayOfYear)
            {
                TipoTransferencia tt = GetTipoTransferenciaBonifInsrAnunDiarioPorClaseUsuario(user.ClasesUsuarios.Nombre);
                user.Puntos += Convert.ToDecimal(tt.Cantidad);
                user.FechaUltimoAnuncio = DateTime.Now;
                Transferencia t = new Transferencia();
                t.Fecha = DateTime.Now;
                t.Puntos = Convert.ToDecimal(tt.Cantidad);
                t.TipoTransferencia = tt;
                t.Usuario = user;
                t.UsuarioDestinoUsuario = user;
                t.UsuarioFuenteUsuario = _usuariorepository.Queryable().Single(x => x.Correo == "info@setvmas.com");
                _transferenciasrepository.Create(t);
                _usuariorepository.Update(user);

                return Convert.ToDecimal(tt.Cantidad);

                // _unitOfWork.SaveChanges();
            }

            return 0;

        }

        /// <summary>
        /// Metodo que devuelve el tipo de transferencia con la cantidad de puntos a bonificar segun la clase del usuario
        /// por el primer anuncio del dia.
        /// </summary>
        /// <param name="claseUser">Nombre de la clase de usuario</param>
        /// <returns>Tipo de transferencia a bonificar</returns>
        private TipoTransferencia GetTipoTransferenciaBonifInsrAnunDiarioPorClaseUsuario(string claseUser)
        {
            switch (claseUser)
            {
                case "Iniciado":
                    {

                        return _tiposTransferenciasrepository.Queryable().First(v => v.NombreCodigo == "BONIF_PRIM_ANUN_DIA_CLI");

                    }
                case "Bronce":
                    {

                        return _tiposTransferenciasrepository.Queryable().First(v => v.NombreCodigo == "BONIF_PRIM_ANUN_DIA_CLB");

                    }
                case "Plata":
                    {

                        return _tiposTransferenciasrepository.Queryable().First(v => v.NombreCodigo == "BONIF_PRIM_ANUN_DIA_CLP");

                    }
                case "Oro":
                    {

                        return _tiposTransferenciasrepository.Queryable().First(v => v.NombreCodigo == "BONIF_PRIM_ANUN_DIA_CLO");

                    }
                case "Diamante":
                    {

                        return _tiposTransferenciasrepository.Queryable().First(v => v.NombreCodigo == "BONIF_PRIM_ANUN_DIA_CLD");

                    }

                default:
                    {
                        return null;
                    }

            }

        }

        //GET: api/Anuncios/Ocultar/5
        //[Authorize(Roles = "Super Administrador, Administrador")]
        [HttpGet]
        [Route("Ocultar/{id}")]
        public async Task<IActionResult> OcultarAnuncio([FromRoute] int id)
        {
            if (!ModelState.IsValid)
            {
                return BadRequest(ModelState);
            }
            Anuncios anuncio = _anunciosRepository.Find(id);
            anuncio.FechaModificacion = DateTime.Now;
            anuncio.IsVisible = !anuncio.IsVisible;
            anuncio.IsActivo = !anuncio.IsActivo;
            _anunciosRepository.Update(anuncio);

            foreach (Banners banner in _bannersrepository.Queryable().Where(x=>x.AnuncioId==id))
            {
                banner.IsActivo = anuncio.IsVisible;
                _bannersrepository.Update(banner);
            }
          

            try
            {
                await _unitOfWork.SaveChangesAsync();
            }
            catch (DbUpdateConcurrencyException)
            {
                if (!AnuncioExists(anuncio.AnuncioId))
                {
                    return NotFound();
                }
                else
                {
                    throw;
                }
            }

            return Ok(anuncio);
        }

